function add() {

    let add = 40 + 4;
    return add;

}
function sub() {
    let sub = 40 - 4;
    return sub;
}
function div() {
    let div = 40 / 3;
    return div;

}
function mul() {
    let mul = 40 * 4;
    return mul;

}

export {add, sub, mul, div};
